 // add the options to the button
  d3.select("#selectquarter")
    .selectAll('myOptions')
    .data([1,2,3,4,5,6])
    .enter()
    .append('option')
    .text(function (d) { return d; }) // text showed in the menu
    .attr("value", function (d) { return d; }) // corresponding value returned by the button
    
  // X axis: scale and draw:
  var x = d3.scaleLinear()
      .domain([0, d3.max(pd_data[quarter])])     // can use this instead of 1000 to have the max of data: d3.max(data, function(d) { return +d.price })
      .range([0, pd_width]);
  pd_svg.append("g")
      .attr("transform", "translate(0," + pd_height + ")")
      .call(d3.axisBottom(x));

  // Y axis: initialization
  var y = d3.scaleLinear()
      .range([pd_height, 0]);
  var yAxis = pd_svg.append("g")

  // A function that builds the graph for a specific value of bin
  function update(nBin) {

    // set the parameters for the histogram
    var histogram = d3.histogram()
        .value(function(d) { return d; })   // I need to give the vector of value
        .domain(x.domain())  // then the domain of the graphic
        .thresholds(x.ticks(nBin)); // then the numbers of bins

    // And apply this function to data to get the bins
    var bins = histogram(pd_data[quarter]);

    // Y axis: update now that we know the domain
    y.domain([0, d3.max(bins, function(d) { return d.length; })]);   // d3.hist has to be called before the Y axis obviously
    yAxis
        .transition()
        .duration(1000)
        .call(d3.axisLeft(y));

    // Join the rect with the bins data
    var u = pd_svg.selectAll("rect")
        .data(bins)

    // Manage the existing bars and eventually the new ones:
    u
        .enter()
        .append("rect") // Add a new rect for each new elements
        .merge(u) // get the already existing elements as well
        .transition() // and apply changes to all of them
        .duration(1000)
          .attr("x", 1)
          .attr("transform", function(d) { return "translate(" + x(d.x0) + "," + y(d.length) + ")"; })
          .attr("width", function(d) { return x(d.x1) - x(d.x0) -1 ; })
          .attr("height", function(d) { return pd_height - y(d.length); })
          .style("fill", "#69b3a2")


    // If less bar in the new histogram, I delete the ones not in use anymore
    u
        .exit()
        .remove()
	
    // Add X axis label:
    pd_svg.append("text")
	    .attr("text-anchor", "end")
	    .attr("x", pd_width)
	    .attr("y", pd_height + margin.top)
	    .text("Seconds left");

	// Y axis label:
	pd_svg.append("text")
	    .attr("text-anchor", "end")
	    .attr("transform", "rotate(-90)")
	    .attr("y", -margin.left + 14	)
	    .attr("x", -margin.top)
	    .text("Total point scored")

    }
    

  // Initialize with 20 bins
  update(binsize)


  // Listen to the button -> update if user change it
  d3.select("#nBin").on("change", function() {
    binsize=this.value
    update(binsize, quarter);
  });
  
  // Listen to the slider?
  d3.select("#selectquarter").on("change", function(d){
    quarter = this.value
    update(binsize)
  })
